import React from 'react';
import cardBackground from '../../../card_background.png';
import './Back.css';

const Back = () => (
  <div className="card">
    <div className="card__points">
      <img src={cardBackground} className="App-logo" alt="logo" />
    </div>
  </div>
);

export default Back;
